import React,{useState,useEffect} from 'react';
import { Link } from 'react-router-dom';
import Button from 'react-bootstrap/Button'
import Card from 'react-bootstrap/Card'
import Nav from 'react-bootstrap/Nav'
import axios from 'axios'
import Profile from './Profile'
function Dashboard(props) {
    const [user, setUser] = useState([]);
    useEffect(() => {
        async function fetchMyAPI()
        {
            await axios.get('http://localhost:8080/users/'+props.match.params.id)
            .then((users)=>
            {
                user=setUser(users.data);
            })
            .catch((err)=>console.log("oh"+err))
        }
        fetchMyAPI();
    }, [])
    console.log(user);
  return (
    <div>
      <Nav fill variant="tabs" defaultActiveKey="/home">
        <Nav.Item>
          <Nav.Link href="/home">Active</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="link-1">Update</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="link-2"></Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="disabled" disabled>
            Disabled
          </Nav.Link>
        </Nav.Item>
      </Nav>
      {!user && <h4>Loading</h4>}
      {user.length>0 && <div><p>Welcome {user[0].name}</p><h1>{user[0].roll}</h1></div>}
      {/* {user.length && <Profile users={user}/>} */}
      {user.length && 

      <Card style={{ width: '18rem' }}>
      <Card.Img variant="top" src="holder.js/100px180" />
        <Card.Body>
          <Card.Title>{user[0].name}</Card.Title>
          <Card.Text>
            <h3>Roll no: {user[0].roll}</h3>
            <h3>Branch: {user[0].branch}</h3>
            <h3>Year of Graduation:{user[0].year}</h3>
            <h3>Welcome</h3>
          </Card.Text>
          <Button variant="primary">Go somewhere</Button>
        </Card.Body>
    </Card>
      }

    </div>
  );
}
export default Dashboard;
